import { useEffect, useState } from "react";
import Base from "../Base";
import { fetchAllArticlesOfUser } from "./helper/articlehelper";


const Home = () => {
    const [articles, setArticles] = useState([])

    useEffect(() => {
        fetchAllArticlesOfUser().then(articles => {
            setArticles(articles)
        }).catch(err => console.log(err))
    }, [])
    return (
        <Base title="Articles" description="All the articles">
            <div className="row">
                {articles && articles.map((article) => {
                    return (
                        <div key={article.id} className="card col-3 mx-4 my-1 text-white bg-dark border border-info">
                            <div className="card-body">
                                <h3 className="text-white text-center">{article}</h3>
                            </div>
                        </div>
                    );
                })}
            </div>

        </Base>
    )
}

export default Home;
